CREATE DEFINER=`user`@`%` FUNCTION `getAvgPriceByLotNumber`(lotNumber NVARCHAR(50)) RETURNS decimal(19,5)
    DETERMINISTIC
BEGIN
DECLARE avg_price decimal(19,5);
select (p.net_amount / p.qty)  into avg_price from stock_ledger s
inner join purchase p ON s.trans_id=p.id
where s.trans_type='BUY' and s.lot_number=lotNumber;
RETURN avg_price;
END ;;
