CREATE DEFINER=`user`@`%` FUNCTION `getProfitByMonthOrYear`(
 userId nvarchar(50),
 periodType char,
 period nvarchar(50)
) RETURNS decimal(10,2)
    DETERMINISTIC
BEGIN
	DECLARE retValue decimal(18,2);
	IF periodType='M' THEN
		SELECT 
		sum((s.net_amount - (select (st.net_amount / st.stock_in) * s.out_stock  buy_net_amount from stock_ledger st  where st.trans_type !='SALE' and st.lot_number= s.lot_number))) into retValue
		FROM stock_ledger s 
		inner join  companies c ON s.company=c.id
		where s.trans_type='SALE' and s.user_id=userId and DATE_FORMAT(s.trans_date,"%Y-%m") = DATE_FORMAT(period,"%Y-%m") ;

    END IF;
    
    IF periodType='Y' THEN
		
SELECT 
sum((s.net_amount - (select (st.net_amount / st.stock_in) * s.out_stock  buy_net_amount from stock_ledger st  where st.trans_type !='SALE' and st.lot_number= s.lot_number))) into retValue
 FROM stock_ledger s 
inner join  companies c ON s.company=c.id
where s.trans_type='SALE' and s.user_id=userId and DATE_FORMAT(s.trans_date,"%Y") =period ;
    END IF ;
    
RETURN retValue;

END ;;
