CREATE DEFINER=`user`@`%` PROCEDURE `getProfitDetailsByUser`(
IN userId NVARCHAR(50),
IN fromDate datetime,
IN toDate datetime
)
BEGIN
 SELECT 
 uuid() as id,
DATE_FORMAT(s.trans_date,"%Y-%m-%d %h:%i") as sales_date, c.code , c.name ,
 sum(sl.out_stock * getAvgPriceByLotNumber(sl.lot_number)) as purchase_amount,
 sum(sl.net_amount) sales_amount  ,
 sum(sl.net_amount-(sl.out_stock * getAvgPriceByLotNumber(sl.lot_number))) as profit
 FROM sales s
inner join companies c ON s.company=c.id
inner join stock_ledger sl ON s.id=sl.trans_id
 where s.user_id=userId and DATE(s.trans_date) between DATE(fromDate) and DATE(toDate)
 group by  s.trans_date , c.code , c.name 
 order by s.trans_date desc;
 
END ;;
