	commission_rate,
    c.price as current_price
 FROM stock_ledger s
 inner join companies c ON s.company=c.id
 where s.user_id= userId and s.company=companyId
group by s.company , s.lot_number
having stock > 0;
 
select uuid() into tNameStep2;
create 
TEMPORARY
 TABLE tNameStep2
 ENGINE=MEMORY 
  select 
  id, 
  company_id,
    name as company,
      stock as qty,
        price,
          ((stock * price) / 100) * commission_rate as chargers,
            (stock * price) + ((stock * price) / 100) * commission_rate as  amount,
  trans_date as date,
  lot_number,
  current_price
 
  from tNameStep1;
  
  select 
  id ,
  company_id,
  company,
  qty,
  amount / qty as price,
  chargers,
  amount,
  date,
  lot_number,
  current_price
  
  from tNameStep2;
  
